var usaString='<div id="content"><div id="siteNotice"><a onclick=$(".sidebar.bottom").trigger("sidebar:close");><i class="fa fa-times pull-right"></i></a></div><h1 id="firstHeading" class="firstHeading">USA</h1><div id="bodyContent"><h2>Regions</h2><p>Northeast - Red<br>Southeast - Green<br>Midwest - Blue<br>Southwest - Yellow<br>West - Purple</p><div id="q_opt" class="btn-group" data-toggle="buttons"><label class="btn btn-default active" id="radio_regions"><input id="radio_regions" name="op" type="radio" value="0" />Regions</label><br><label class="btn btn-default" id="radio_red_blue"><input id="radio_red_blue" name="op" type="radio" value="1" />Red / Blue States</label><br></div><label class="btn btn-default" id="radio_population"><input id="radio_population" name="op" type="radio" value="2" />Show Population</label><br></div><label class="btn btn-default" id="radio_clear"><input id="radio_clear" name="op" type="radio" value="3" />Clear</label><br></div></div></div>',brazilString='<div id="content"><div id="siteNotice"><a onclick=$(".sidebar.bottom").trigger("sidebar:close");><i class="fa fa-times pull-right"></i></a></div><h1 id="firstHeading" class="firstHeading">Brazil</h1><div id="bodyContent"><p align="left"><b>ok</b>test</p></div></div>',denmarkString='<div id="content"><div id="siteNotice"><a onclick=$(".sidebar.bottom").trigger("sidebar:close");><i class="fa fa-times pull-right"></i></a></div><h1 id="firstHeading" class="firstHeading">Denmark</h1><div id="bodyContent"><p align="left"><b>hello</b>test</p></div></div>',edmundPettusBridgeString='<div id="content"><div id="siteNotice"><a onclick=$(".sidebar.bottom").trigger("sidebar:close");><i class="fa fa-times pull-right"></i></a></div><h1 id="firstHeading" class="firstHeading">Edmund Pettus Bridge</h1><div id="bodyContent"><img class="imgStreet" src="https://maps.googleapis.com/maps/api/streetview?size=1000x500&location=32.4054951,-87.0185059&heading=247.58&pitch=15&key=AIzaSyAxmMoaV9GrSom0cLblARIad6quTrkSSt0"><br><br><p align="left">Edmund Winston Pettus (July 6, 1821 - July 27, 1907) was a Confederate general in the American Civil War. After the war, he led the Alamaba Ku Klux Klan as Grand Dragon.The bridge was the site of the Selma to Montgomery marches and "Bloody Sunday", where peaceful African-American protesters were attacked by armed police officers with Billy clubs and tear gas.The Edmund Pettus bridge was named in his honor and ironically became a landmark in the March on Selma.</p></div></div>',ancientBuryingGroundString='<div id="content"><div id="siteNotice"><a onclick=$(".sidebar.bottom").trigger("sidebar:close");><i class="fa fa-times pull-right"></i></a></div><h1 id="firstHeading" class="firstHeading">Ancient Burying Ground</h1><div id="bodyContent"><img class="imgStreet" src="https://maps.googleapis.com/maps/api/streetview?size=1000x500&location=41.764495,-72.673782&heading=-80&pitch=15&key=AIzaSyAxmMoaV9GrSom0cLblARIad6quTrkSSt0"><br><br><p align="left">The Ancient Burying Ground is a historic cementary on 60 Gold Street, Hartford, CT. The First Church of Christ, located next to the cementary, is the oldest church in Hartford.</p></div></div>',grandCanyonString='<div id="content"><div id="siteNotice"><a onclick=$(".sidebar.bottom").trigger("sidebar:close");><i class="fa fa-times pull-right"></i></a></div><h1 id="firstHeading" class="firstHeading">Grand Canyon</h1><div id="bodyContent"><img class="imgStreet" src="https://maps.googleapis.com/maps/api/streetview?size=1000x500&location=36.0697473,-112.1628547&heading=0&pitch=0&key=AIzaSyAxmMoaV9GrSom0cLblARIad6quTrkSSt0"><br><br><p align="left">The Grand Canyon is formed by geologic color and erosion. The canyon is vast and spreads past 1 million acres of land.</p></div></div>',crystalBridgesString='<div id="content"><div id="siteNotice"><a onclick=$(".sidebar.bottom").trigger("sidebar:close");><i class="fa fa-times pull-right"></i></a></div><h1 id="firstHeading" class="firstHeading">Crystal Bridges Museum of American Art</h1><div id="bodyContent"><img class="imgStreet" src="https://maps.googleapis.com/maps/api/streetview?size=1000x500&location=36.382534,-94.203476&heading=0&pitch=0&key=AIzaSyAxmMoaV9GrSom0cLblARIad6quTrkSSt0"><br><br><p align="left">The Crystal Bridges Museum of American Art is located in Bentonville, Arkansas. The museum was founded by Alice Walton and designed by Moshe Safdie. The museum opened on November 11, 2011 and is free for everyone.The museum features portraits of George Washington painted by Charles Wilson Peale’s and Gilbert Stuart’s, Asher Brown Durand’s Kindred Spirits, and Norman Rockwell’s Rosie the Riveter.There are also famous works by other artists such as John Singer Sargent, Thomas Eakins, William Merritt Chase, Thomas Hart Benton, and Andy Warhol.</p></div></div>',hearstCastleString='<div id="content"><div id="siteNotice"><a onclick=$(".sidebar.bottom").trigger("sidebar:close");><i class="fa fa-times pull-right"></i></a></div><h1 id="firstHeading" class="firstHeading">Hearst Castle</h1><div id="bodyContent"><iframe class="imgStreet" width="1000" height="500" frameborder="0" scrolling="no" marginheight="0" marginwidth="0" src="https://www.google.com/maps/embed/v1/streetview?key=AIzaSyAxmMoaV9GrSom0cLblARIad6quTrkSSt0&location=35.6853182,-121.169027&heading=75&pitch=15&fov=35"></iframe><p align="left">The Hearst Castle is located on the Central Cost of California. Architect Julia Morgan designed the castle for William Randolph Hearst from 1919 to 1947. The castle has a wine cellar which protected Hearst\'s collection of alcohol during the prohibition era. There is also an airport which was built in the 1920s so that Hearst\'s famous guests could get to his estate faster than by train or car. There used to be the world\'s largest private zoo with zebras, aoudads, and Sambar deer. There are two pools at the castle: the Neptune Pool and the Roman Pool. Originally, the Neptune pool was supposed to be small and decorated with surrounding ornaments. However, on March 31, 1924, William Randolph Hearst wrote a letter to Julia Morgan and said that his wife and children want the pool to be as large as a swimming pool and to disregard the temple structure. The indoor Roman Pool has 205,000 gallons of water and a depth of 10 feet.</p></div></div>';